import PropertyDetailedItem from "../component/properties/PropertyDetailedItem";
import PropertyItem from "../component/properties/PropertyItem";
import { useState, useEffect } from "react";
import { useParams } from 'react-router-dom';


function DetailPropertyPage() {
  const {barcode} = useParams();
  const [isLoading, setIsLoading] = useState(true);
  const [loadedProp, setLoadedProp] = useState([]);

  useEffect(() => {
    setIsLoading(true);
  fetch("http://localhost:3000/products/"+ barcode )
    .then((response) => {
      setLoadedProp(response)
      console.log(loadedProp.data)
      return response.json();
    })
    .then((data) => {
      console.log({barcode})
      setIsLoading(false)
      
    });

  }, []);

  
  if(isLoading){
    return (
      <section>
        <p>
          loading...
        </p>
      </section>
    );
  }
  console.log(loadedProp)
  return (
    <section>
      <h1>detail</h1>
      <PropertyItem properties={loadedProp.docs} />
    </section>
  );
}

export default DetailPropertyPage;
